import Vue from 'vue'
import App from './App.vue'
// 引入ui组件
import {
  Message
} from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
// 使用ui组件
Vue.use(ElementUI)

Vue.prototype.$Message = Message

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
